Automobilis pastatytas dalinai ant dviračių tako ir kelia pavojų eismo saugumui. Pažeisti šie KET punktai: 150.6 ir 150.10

150.6. ant pėsčiųjų ar (ir) dviračių tako, dviračių juostos, taip pat arčiau kaip 5 m atstumu prieš važiuojamosios dalies susikirtimą su pėsčiųjų ar (ir) dviračių taku, o keliuose, kuriuose yra po vieną kiekvienos krypties eismo juostą, ir arčiau kaip 5 m atstumu už pėsčiųjų ar (ir) dviračių tako;

150.10. ten, kur sustojusi transporto priemonė užstotų kitiems vairuotojams šviesoforo signalus ar kelio ženklus, trukdytų įvažiuoti (išvažiuoti) į (iš) stovėjimo aikštelę (-ės), stovėjimo vietą (-os), garažą (-o), kiemą (-o), teritoriją (-os), trukdytų įlipti į kitą transporto priemonę arba kitaip kliudytų transporto priemonių ar pėsčiųjų eismui;Pažeidimo data ir laikas: 2021-05-07 21:48Automobilio valst. nr.:[duomenys nuasmeninti]

